import React from "react";
import Header from "./Header";
import Home from "./Home";
import Footer from "./Footer";
import { Routes as Switch, Route } from "react-router-dom";

//All Courese
import AllCourses from "./AllCourses";
import PopularCourses from "./PopularCourses";
import PopularTeachers from "./PopularTeachers";
import CategoryCourses from "./CategoryCourses";
import CourseDetail from "./CourseDetail";
import TeacherDetail from "./TeacherDetail";

//Teacher
import TeacherDashboard from "./Teacher/TeacherDashboard";
import TeacherCourses from "./Teacher/TeacherCourses";
import TeacherProfileSetting from "./Teacher/TeacherProfileSetting";
import TeacherChnagePassword from "./Teacher/TeacherChangePassword";
import AddCourse from "./Teacher/AddCourse";
import UserList from "./Teacher/UserList";
import TeacherLogout from "./Teacher/TeacherLogout";
import AddChapter from "./Teacher/AddChapter";
import CourseChapter from "./Teacher/CourseChapter";
import EditChapter from "./Teacher/EditChapter";
import EditCourse from "./Teacher/EditCourse";
import TeacherSkillsCategory from "./TeacherSkillsCategory";
import EnrolledStudents from "./Teacher/EnrolledStudents";

//Student
import Register from "./User/Register";
import Login from "./User/Login";
import Logout from "./User/Logout";
import Dashboard from "./User/Dashboard";
import MyCourses from "./User/MyCourses";
import FavoriteCourses from "./User/FavoriteCourses";
import RecommendedCourses from "./User/RecommendedCourses";
import ProfileSetting from "./User/ProfileSetting";
import ChnagePassword from "./User/ChangePassword";

//Training
import TrainingDetails from "./Teacher/TrainingDetails";
import EdEnrolledStudents from "./Teacher/EdEnrolledStudents";
import UserTrainingDetails from "./User/UserTrainingDetails";
import TrainingCourses from "./Training/TrainingCourses";
import TrainingCourseDetail from "./Training/TrainingCourseDetail";
import PlayVideo from "./Course/PlayVideo";

//Public Details
import AboutUs from "./Public/AboutUs";
import ContactUs from "./Public/ContactUs";

function Didactic() {
  return (
    <div className="App">
      <Header />

        <Route path="/dc/" element={<Home />} />
        <Route path="/dc/course-detail/:course_id" element={<CourseDetail />} />
        <Route path="/dc/teacher-detail/:teacher_id" element={<TeacherDetail />} />

        {/*Trainer */}
        <Route path="/dc/teacher-logout" element={<TeacherLogout />} />
        <Route path="/dc/teacher-dashboard/" element={<TeacherDashboard />} />
        <Route path="/dc/teacher-courses" element={<TeacherCourses />} />
        <Route path="/dc/add-course" element={<AddCourse />} />
        <Route path="/dc/edit-course/:course_id" element={<EditCourse />} />
        <Route path="/dc/teacher-users" element={<UserList />} />
        <Route path="/dc/add-chapter/:course_id" element={<AddChapter />} />
        <Route path="/dc/all-chapters/:course_id" element={<CourseChapter />} />
        <Route path="/dc/edit-chapter/:chapter_id" element={<EditChapter />} />
        <Route
          path="/dc/teacher-profile-setting"
          element={<TeacherProfileSetting />}
        />
        <Route
          path="/dc/teacher-change-password"
          element={<TeacherChnagePassword />}
        />
        <Route
          path="/dc/enrolled-students/:course_id"
          element={<EnrolledStudents />}
        />

        {/*Student */}
        <Route path="/dc/user-logout" element={<Logout />} />
        <Route path="/dc/user-dashboard" element={<Dashboard />} />
        <Route path="/dc/my-courses" element={<MyCourses />} />
        <Route path="/dc/favorite-courses" element={<FavoriteCourses />} />
        <Route path="/dc/recommended-courses" element={<RecommendedCourses />} />
        <Route path="/dc/profile-setting" element={<ProfileSetting />} />
        <Route path="/dc/change-password" element={<ChnagePassword />} />

        {/* All Courses */}
        <Route path="/dc/all-courses" element={<AllCourses />} />
        <Route path="/dc/popular-courses" element={<PopularCourses />} />
        <Route path="/dc/popular-teachers" element={<PopularTeachers />} />
        <Route path="/dc/category/:category_slug" element={<CategoryCourses />} />
        <Route
          path="/dc/teacher-skill-courses/:skill_name/:teacher_id"
          element={<TeacherSkillsCategory />}
        />

        {/* Traing */}
        <Route path="/dc/training-details/" element={<TrainingDetails />} />
        <Route
          path="/dc/edenrolled-students/:course_id"
          element={<EdEnrolledStudents />}
        />
        <Route
          path="/dc/user-training-details/"
          element={<UserTrainingDetails />}
        />
        <Route path="/dc/training-courses/" element={<TrainingCourses />} />
        <Route
          path="/dc/training-course-detail/:course_id"
          element={<TrainingCourseDetail />}
        />

        {/* Learnig Page */}
        <Route path="/dc/learning-course/:course_id/" element={<PlayVideo />} />

        {/* Public Details */}

        <Route path="/dc/aboutUs" element={<AboutUs />} />
        <Route path="/dc/contactUs" element={<ContactUs />} />

      <Footer />
    </div>
  );
}

export default Didactic;
